INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES ("2025/01/31 12:00:00", 61, 10201, 3, 1020101, -6.0, -285.0, 101, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, "ラビリスタ", 133701, 5.18);
